import Button from './Button';

const CalcualtorButtons = () => {
  return (
    <div>
      <Button style={styles} item="2" itemType="number" />
    </div>
  );
};

const styles = {
  width: '20%',
  height: '20%'
};

export default CalcualtorButtons;
